	methods: {
		calPosition: function(){
			var boards = this.boards;
			for(var i=0;i<boards.length;i++)
			{
				current_y = boards[i].y;
				current_type = "top";
				for(var j=0;j<boards[i]["groups"].length;j++)
				{
					if(current_type=="top"){
						current_y += 15;	
					}
					else if(current_type=="title"){
						current_y += 12;
					}
					else if(current_type=="text"){
						current_y += 15;
					}
					current_type = "title";
					var group = boards[i]["groups"][j];
					group.y=current_y;
					for(var k=0;k<group.textgroups.length;k++){
						if(current_type=="title"){
							current_y += 12;
						}
						else if(current_type=="text"){
							current_y += 10;
						}
						current_type = "text";
						group.textgroups[k].y = current_y;
					}	
				}
			}
		}
	}

		calPosition: function(){

			{

				current_type = "top";
				for(var j=0;j<boards[i]["groups"].length;j++)
				{
					if(current_type=="top"){
						current_y += 15;	
					}
					else if(current_type=="title"){
						current_y += 12;
					}
					else if(current_type=="text"){
						current_y += 15;
					}
					current_type = "title";
					var group = boards[i]["groups"][j];
					group.y=current_y;
					for(var k=0;k<group.textgroups.length;k++){
						if(current_type=="title"){
							current_y += 12;
						}
						else if(current_type=="text"){
							current_y += 10;
						}
						current_type = "text";
						group.textgroups[k].y = current_y;
					}	
				}
			}
